INSERT INTO `product` VALUES (1,'Fullflex Tights','fullflex-tights',1,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/fullflex_tights_2019_07_01_09_34_11.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:13','1970-01-17 07:53:13','fullflex-tights','The FullFlex Tights support you during all Freeletics workouts. All-Way-Stretch material fits like a second skin, guarantees maximum freedom of movement, and provides your muscles with additional support. The Silicone Grip provides optimum support. Thanks to its high abrasion resistance, the high-quality material is ideal for Freeletics training.',1,1,1,0,2),(2,'Freeknit Tee Black','freeknit-tee-black',2,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/freeknit_tee_black_2019_07_01_10_05_25.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:14','1970-01-17 07:53:14','freeknit-tee-black','The FreeKnit Tee Black was designed for performance. An ultra-lightweight and extremely quick-drying fabric combined with a heat map mesh construction gives you control over any workout. Now available in black with a re-designed neckline. Our model is 1.89 m and wears size M.',1,1,1,0,2),(3,'Reflective Hexagon Shorts','reflective-hexagon-shorts',3,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/reflective_hexagon_shorts_2019_07_01_10_08_54.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:14','1970-01-17 07:53:14','reflective-hexagon-shorts','Made of ultra lightweight and stretchy polyester fabric, the Reflective Hexagon shorts keep your skin dry and offer the freedom of movement Freeletics workouts require. Reflective prints create a distinctive silhouette in the dark and built-in pockets keep your Coach at your fingertips at all times. Our model is 1,82 m tall and wears size M',1,1,1,0,2),(4,'Light Crewneck','light-crewneck',4,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/light_crewneck_2019_07_01_10_10_02.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:14','1970-01-17 07:53:14','light-crewneck','Whether your warming up, cooling down, or chilling out, this Light Crewneck, made of moisture-regulating performance material, keeps you cool, consistent and focused. With a printed statement on the sleeves, you can wear your Freeletics lifestyle with pride and make your “No Excuses” motto known',1,1,1,0,2),(5,'Light Crewneck Dark Denim','light-crewneck-dark-denim',5,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/light_crewneck_dark_denim_2019_07_01_10_11_17.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:14','1970-01-17 07:53:14','light-crewneck-dark-denim','Whether your warming up, cooling down, or chilling out, this Light Crewneck, made of moisture-regulating performance material, keeps you cool, consistent and focused. With a printed statement on the sleeves, you can wear your Freeletics lifestyle with pride and make your “No Excuses” motto known.',1,1,1,0,2),(6,'Performance Tank Dark Denim','performance-tank-dark-denim',6,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/performance_tank_dark_denim_2019_07_01_10_14_35.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:14','1970-01-17 07:53:14','performance-tank-dark-denim','The athletic cut of the Performance Tank ensures full mobility during your workout. Its soft touch and moisture-wicking fabric make it the athlete\'s t-shirt of choice - for training sessions and during days off. Our model is 1.87 m tall and wears size M.',1,1,1,0,2),(7,'Performance Tank','performance-tank',7,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/performance_tank_2019_07_01_10_16_11.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:14','1970-01-17 07:53:14','performance-tank','The athletic cut of the Performance Tank ensures full mobility during your workout. Its soft touch and moisture-wicking fabric make it the athlete\'s t-shirt of choice - for training sessions and during days off. Our model is 1.87 m tall and wears size M.',1,1,1,0,2),(8,'Spartan Hoodie Urban Green','spartan-hoodie-urban-green',8,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/spartan_hoodie_urban_green_2019_07_01_10_16_59.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:14','1970-01-17 07:53:14','spartan-hoodie-urban-green','You gave it your all and even reached a new personal best. Now it’s time to offer your body the best conditions to recover. Our hoodie with its extremely soft, brushed lining and adjustable hood provides warmth and protection, while its edgy look with cut-off details keeps you looking fresh even after the most demanding workout. Leaving you to enjoy your post workout high. #absoluterecovery #postworkouthigh',1,1,1,0,2),(9,'Cold Guard Gloves Black','cold-guard-gloves-black',9,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/cold_gurad_gloves_black_2019_07_01_10_19_21.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:14','1970-01-17 07:53:14','cold-guard-gloves-black','Ready for your next Metis in the cold? With our mid-weight Cold Guard Gloves, there\'s no reason not to be. With a moisture-wicking brushed material on the inside, not only are your fingers kept warm while you work out, but they are also soft and comfortable - making them the ideal gloves for your winter training sessions. Special touch points on your thumbs and index fingers allow full smartphone and Coach operation. No more \"it\'s too cold to train\". No excuses!',1,1,1,0,2),(10,'Cold Guard Gloves','cold-guard-gloves',10,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/cold_gurad_gloves_2019_07_01_10_20_41.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:14','1970-01-17 07:53:14','cold-guard-gloves','Ready for your next Metis in the cold? With our mid-weight Cold Guard Gloves, there\'s no reason not to be. With a moisture-wicking brushed material on the inside, not only are your fingers kept warm while you work out, but they are also soft and comfortable - making them the ideal gloves for your winter training sessions. Special touch points on your thumbs and index fingers allow full smartphone and Coach operation. No more \"it\'s too cold to train\". No excuses!',1,1,1,0,2),(11,'Blackout Snapback','blackout-snapback',11,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/blackout_snapback_2019_07_01_10_22_00.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:15','1970-01-17 07:53:15','blackout-snapback','The Blackout Snapback is a flat brim cap that doesn\'t sacrifice looks for performance. Its black on black design is perfect for everyday wear or to step-up your training ground style. Moisture-wicking materials keep your head cool and dry. A revised cut and adjustable snapback closure provide a finely tuned fit. A sweat resistant synthetic insert in brim keeps the cap in pristine shape during sweaty training sessions.',1,1,1,0,2),(12,'Freeletics Tube','freeletics-tube',12,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/freeletic_tube_2019_07_01_10_22_46.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:15','1970-01-17 07:53:15','freeletics-tube','The Freeletics Tube is a uniquely versatile scarf for almost any activity. It can be worn in many different ways: as a scarf, headband or headgear. It has been designed for your needs, protection, and comfort so you can stay fully focused on performing your best.',1,1,1,0,2),(13,'Freeletics Tube Hexagon','freeletics-tube-hexagon',13,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/freeletics_tube_hexagon_2019_07_01_10_24_05.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:15','1970-01-17 07:53:15','freeletics-tube-hexagon','The Freeletics Tube is a uniquely versatile scarf for almost any activity. It can be worn in many different ways: as a scarf, headband or headgear. It has been designed for your needs, protection, and comfort so you can stay fully focused on performing your best.',1,1,1,0,2),(14,'6-Years Limited Edition Water Bottle','6-years-limited-edition-water-bottle',14,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/6_years_limited_edition_water_bottle_2019_07_01_10_25_52.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:15','1970-01-17 07:53:15','6-years-limited-edition-water-bottle','6 years of No Excuses! Celebrate with us! The 600 ml 6-Years Limited Edition Water Bottle holds more than enough liquid to keep you hydrated during the most intensive workouts. With a secured flip-top fastening, it\'s easy to open with no danger of leaking and the large twist lock makes it simple to fill and clean. The perfect bottle for on the move. Take it wherever your training takes you and stay hydrated for those extra rounds.',1,1,1,0,2),(15,'Hexagon Tee Dark Denim','hexagon-tee-dark-denim',15,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/hexagon_tee_dark_denim_2019_07_01_10_27_22.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:15','1970-01-17 07:53:15','hexagon-tee-dark-denim','Subtle and stylish, yet made for performance. The Hexagon Tee is made of a moisture-regulating and quick-drying cotton-polyester mix. Whether you’re on the training ground of taking a timeout, wear your hexagon with pride.',1,1,1,0,2),(16,'Limitless Tee','limitless-tee',16,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/limitless_tee_2019_07_01_10_28_51.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:15','1970-01-17 07:53:15','limitless-tee','The Limitless Tee for limitless athletes. With a printed logo on the front and lose cut, it provides a casual, yet committed look. Thanks to the moisture-regulating and robust material, this shirt is sure to become your must-have piece - whether it’s in your free time or during your next workout.',1,1,1,0,2),(17,'Limitless Tee Dark Denim','limitless-tee-dark-denim',17,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/limitless_tee_dark_denim_2019_07_01_10_29_55.jpg','null',49.5,0,1,100,1