 of seamless FreeKnit material offers extreme comfort with breathable mesh inserts, while the ergonomic fit with elegant straps gives you an athletic shape.',1,1,1,0,3),(38,'Anytime Shorts','anytime-shorts',38,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/anytime_shorts_2019_07_01_10_57_45.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:17','1970-01-17 07:53:17','anytime-shorts','Ideal for indoor and outdoor training, our Anytime Shorts are lightweight with an extra comfortable fit and water-repellent outer material. Best worn in colder temperatures layered up with tights underneath or as a single layer during summer workouts or training indoors.Our model is 1,73 m tall and wears size S.',1,1,1,0,3),(39,'Hybrid Motion Shorts','hybrid-motion-short-women',39,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/hybrid_motion_shorts_2019_07_01_10_58_35.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:17','1970-01-17 07:53:17','hybrid-motion-short-women','Hybrid Motion Shorts designed with a tight-fitting underlayer and a lightweight upper layer. This design not only flatters your figure but also combines freedom of movement, comfort, and support for your Freeletics workout.',1,1,1,0,3),(40,'FullFlex Tights 2015','fullflex-tights-women-2015',40,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/fullflex_tights_2015_2019_07_01_10_59_44.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:17','1970-01-17 07:53:17','fullflex-tights-women-2015','The FullFlex Tights made from snug-fitting All Way Stretch material are designed to combine complete freedom of movement with opaque perception and an elegant look. The silicone grip also provides optimum support during your workouts. Thanks to its high abrasion resistance, the high-quality PA-material is ideal for Freeletics workouts.',1,1,1,0,3),(41,'FullFlex Workout Bra','fullflex-workout-bra-wome',41,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/f