ainshield-gymbag-black',47,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/rainshield_gymbag_black_2019_07_01_11_08_07.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:17','1970-01-17 07:53:17','rainshield-gymbag-black','Going for a workout on your way to the office? Easy! The waterproof Gym Bag adjusts to your everyday life. With its covered seams, a padded laptop compartment, separate section for sneakers. and a detachable water-repellent cell phone pocket, your gear stays dry in all conditions. Wear it as a sling bag or as a backpack thanks to the variable straps. #allinone #fromofficetoworkout The training mat is not part of the delivery of this product and can be ordered separately.',1,1,1,0,4),(48,'No Excuses Bar','no-excuses-bar',48,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/no_excuses_bar_2019_07_01_11_09_05.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:17','1970-01-17 07:53:17','no-excuses-bar','Unleash your potential with our No Excuses pull up bar. Developed for athletes who appreciate the flexibility of working out and strive for improvement no matter where they are. Perfectly easy to install in most doorframes and fully adjustable, with or without brackets and screws, the robust construction adds safety and reliability to your workouts.',1,1,1,0,4),(49,'Starter Pack','starter-pack',49,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/starter_pack_2019_07_01_11_09_50.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:17','1970-01-17 07:53:17','starter-pack','Unleash your potential with our No Excuses pull up bar. Developed for athletes who appreciate the flexibility of working out and strive for improvement no matter where they are. Perfectly easy to install in most doorframes and fully adjustable, with or without brackets and screws, the robust construction adds safety and reliability to your workouts.',1,1,1,0,4),(50,'6-Years Limited Edition Water Bottle','6-years-limited-edition-water-bottle',50,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/6_year_limited_edition_water_bottle_2019_07_01_11_10_47.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:17','1970-01-17 07:53:17','6-years-limited-edition-water-bottle','6 years of No Excuses! Celebrate with us! The 600 ml 6-Years Limited Edition Water Bottle holds more than enough liquid to keep you hydrated during the most intensive workouts. With a secured flip-top fastening, it\'s easy to open with no danger of leaking and the large twist lock makes it simple to fill and clean. The perfect bottle for on the move. Take it wherever your training takes you and stay hydrated for those extra rounds.',1,1,1,0,4),(51,'Resistance Band Black','resistance-band-black',51,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/resistance_band_black_2019_07_01_11_11_33.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:18','1970-01-17 07:53:18','resistance-band-black','Our resistance bands allow you to build your pull-up technique and enhance your bodyweight exercises. The black band offers less resistance than the blue band and is best suited for advanced Free Athletes.',1,1,1,0,4),(52,'Resistance Band Blue','resistance-band-blue',52,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/resistance_band_blue_2019_07_01_11_12_31.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:18','1970-01-17 07:53:18','resistance-band-blue','Our resistance bands allow you to build your pull-up technique and enhance your bodyweight exercises. The blue band offers more resistance than the black band and is best suited for beginner Free Athletes.',1,1,1,0,4),(53,'Sweatproof Towel','sweatproof-towel',53,'http://localhost:8080/greenwich-fitness/api/v1/resources/upload/product/sweatproof_towel_2019_07_01_11_13_25.jpg','null',49.5,0,1,100,12,'1970-01-17 07:53:18','1970-01-17 07:53:18','sweatproof-towel','Just completed a challenging Aphrodite? Fix up, get fresh right and prepare to take 